Encoding ABIs that contain custom types, such as structs, is similar to encoding a set of primitive types. The encoding will proceed in the order that the inner types of a custom type are declared and recursively just like encoding any other type. This way you can encode structs with primitive types or structs with more complex types in them such as other structs, arrays, strings, and enums. Here's an example: struct InputStruct { field_1: bool, field_2: u8,
} abi MyContract { fn foo(a: u64); fn bar(a: InputStruct);
} { fn baz(a: ()) { }
} Calling bar with InputStruct { field_1: true, field_2: 5 } yields: 0x
0000000000000001 // `true` encoded as a bool
0000000000000005 // `5` encoded as u8 A more complex scenario: struct InputStruct { field_1: bool, field_2: [u8; 2], // An array of u8, with length 2.
} abi MyContract { fn foo(a: u64); fn bar(a: InputStruct);
} { fn baz(a: ()) { }
} Calling bar with InputStruct { field_1: true, field_2: [1, 2] } yields: 0x
0000000000000001 // `true` encoded as a bool
0000000000000001 // `1` encoded as u8
0000000000000002 // `2` encoded as u8

