ABI calls containing enums (sum types) are encoded similarly to structs: encode the discriminant first, then recursively encode the type of the enum variant being passed to the function being called. enum MySumType
{ X: u32, Y: bool,
} abi MyContract { fn foo(a: u64); fn bar(a: MySumType);
} { fn baz(a: ()) { }
} Calling bar with MySumType::X(42) yields: 0x
0000000000000000 // The discriminant of the chosen enum, in this case `0`.
000000000000002a // `42` encoded as u64 If the sum type has variants of different sizes, then left padding is required. enum MySumType
{ X: b256, Y: u32,
} abi MyContract { fn foo(a: u64); fn bar(a: MySumType);
} { fn baz(a: ()) { }
} Calling bar with MySumType::Y(42) yields: 0x
0000000000000001 // The discriminant of the chosen enum, in this case `1`.
0000000000000000 // Left padding
0000000000000000 // Left padding
0000000000000000 // Left padding
000000000000002a // `42` encoded as u64 Note that three words of padding are required because the largest variant of MySumType is 4 words wide. If all the variants of a sum type are of type (), or unit, then only the discriminant needs to be encoded. enum MySumType
{ X: (), Y: (), Z: (),
} abi MyContract { fn foo(a: u64); fn bar(a: MySumType);
} { fn baz(a: ()) { }
} Calling bar with MySumType::Z yields: 0x
0000000000000002 // The discriminant of the chosen enum, in this case `2`.

