ABI calls containing tuples are encoded as such: If X is a tuple with the type signature (T_1, T_2, ..., T_n), with T_1,...,T_n being any type except for vector, then enc(X) is encoded as the concatenation of enc(T_1), enc(T_2),enc (T_3), ..., enc(T_n). abi MyContract { fn foo(a: (u64, str[3], bool));
} { fn foo(a: (u64, str[4], bool)) {};
} Calling foo with (1u64, "fuel", true) : 0x
0000000000000001 // 1u64
